import React, {Component} from 'react'
import './Style/SignUpPage.css'

class SignUpPage extends Component{

    constructor(props){
        super(props)
        this.state={
            mobile: true
        }
    }

    componentDidMount() {
        window.addEventListener("resize", this.resize.bind(this))
        this.resize()
    }

    resize= () => {
        if(window.innerWidth <= 720){
            this.setState({mobile: true})
        }else{
            this.setState({mobile: false})
        }
    }

    render() {
        return(
            <div className="signUp">
                <div className="container-fluid text-center">
                    <div className="row">
                        <div className="col-lg-12">
                            <nav>
                                <div className="nav nav-tabs" role="tablist">
                                    <a className="nav-item nav-link active" id="navOneTrip" data-togle="tab" href="#oneTrip" role="tab" aria-controls="nav-one" aria-selected="true">Sekali Jalan</a>
                                    <a className="nav-item nav-link active" id="navTwoWayTrip" data-togle="tab" href="#twoWayTrip" role="tab" aria-controls="nav-two-way" aria-selected="false">Sekali Jalan</a>
                                </div>
                            </nav>
                            <div className="tab-content" id="nav-tabContent">

                            </div>
                        </div>
                    </div>
                </div>
            </div>
        )
    }
}
export default SignUpPage
